import React, { Component } from 'react';

class App extends Component {
  state = {
    data: {}
  }

  componentDidMount() {
    fetch('https://eftelingapi.herokuapp.com/attractions')
      .then(response => response.json())
      .then(data => this.setState({ data }))
      .then(console.log(this.state));
  };

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
